  useEffect(() => {
    dispatch(listProducts());
  }, [dispatch]);
  const products = [];
  return (
    <React.Fragment>
      <h1>Products To Shop</h1>
      <Row>
        {products.map((product) => (
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product product={product} />
          </Col>
